import React, { Component } from 'react';
import { Button, ButtonGroup, ToggleButtonGroup, ToggleButton} from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'
import { NavLink } from "react-router-dom";
import logo from '../images/mee.png';
import './styles/DashBoard.css';

class DashBoard extends Component {
  render() {
    return (
      <span className="DashBoard">
      	<div>
          <img src={logo} className="App-logo" alt="logo" />
        </div>
        <div className="d-flex flex-column">
			<ToggleButtonGroup vertical>
				<LinkContainer to="/">
	   				<ToggleButton variant="primary" name="radio" value='1'>
	    				Home
	    			</ToggleButton>
				</LinkContainer>
				<LinkContainer to="/About">
	   				<ToggleButton variant="light" name="radio1" value='2'>
	    				About
	    			</ToggleButton>
				</LinkContainer>
				<LinkContainer to="/Contact">
	   				<ToggleButton variant="light" name="radio2" value='3'>
	    				Contact
	    			</ToggleButton>
				</LinkContainer>
			</ToggleButtonGroup>
  		</div>
      </span>
    );
  }
}

export default DashBoard;
